import '../../styles/Card.css';

function Card({ label, title, picture }) {
    return (
        <div className="col-4 col-sm-4 mx-4 wrapper">
            <div className="label mb-4">{label}</div>
            <div className="mb-4 text-center"><img src={picture} alt="freelance" /></div>
            <div className="text-center fw-bold align-text-bottom">{title}</div>
        </div>
    )
}

export default Card
